import { Component } from "react";
import React from "react";

class App extends Component(){
    constructor(){
        super()
        this.state={
            isLogged:true
        }
    }
    render(){
      let worldDisplay
      if(this.isLogged===true)
          worldDisplay="in"
      else
          worldDisplay="out"
        return(
            <div>
                <h1>You are currently logged {worldDisplay}</h1>
            </div>
        )
    }
}

export default App
